            prev_idx = (ear_idx - 1) % len(remaining)
            next_idx = (ear_idx + 1) % len(remaining)
            triangles.append((
                remaining[prev_idx],
                remaining[ear_idx],
                remaining[next_idx]
            ))
            
            remaining.pop(ear_idx)
        
